import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Add multiple products to cart rapidly
    const productCards = await page.$$('.product-card');
    for (let i = 0; i < Math.min(4, productCards.length); i++) {
      const addToCartBtn = await productCards[i].$('.add-to-cart');
      if (addToCartBtn) {
        await addToCartBtn.click();
        // Small delay between clicks to simulate rapid but not simultaneous actions
        await page.waitForTimeout(200);
      }
    }

    // Take screenshot after adding items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open cart modal
    const cartElement = await page.$('.cart');
    if (cartElement) {
      await cartElement.click();
      await page.waitForSelector('#cartModal', { timeout: 5000 });
    }

    // Take screenshot of cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Perform cart manipulations
    const cartItems = await page.$$('.cart-item');
    if (cartItems.length > 0) {
      // Update quantity of first item
      const increaseBtn = await page.$('(//div[@class="cart-item"])[1]//button[contains(@class, "quantity-btn")][2]');
      if (increaseBtn) {
        await increaseBtn.click();
      }

      // Remove second item if exists
      if (cartItems.length > 1) {
        const removeBtn = await page.$('(//div[@class="cart-item"])[2]//button[contains(@class, "remove-item")]');
        if (removeBtn) {
          await removeBtn.click();
        }
      }
    }

    // Wait for cart to update and take final screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_cart_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_cart_updated.png'));

    // Extract cart data to verify manipulation
    const cartCount = await page.$eval('.cart', el => el.textContent.trim());
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim()).catch(() => 'N/A');

    return {
      success: true,
      action: "Performed rapid cart manipulation stress test - added multiple items, updated quantities, and removed items",
      extractedData: {
        finalCartCount: cartCount,
        finalCartTotal: cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
